  false,\n\t\"url\": null,\n\t\"notes\": \"These data were collected by the National
  Ocean Service (NOS, formerly the U.S. Coast and Geodetic Survey) for the purpose
  of charting the coastal waters and navigable waterways of the United States. Data
  collected prior to 1965 were digitized from the final survey plots. All other data
  were digitized in the field during the surveys. These data were supplied by the
  National Geophysical Data Center (NGDC). This data set contains fields that are
  only a subset of those fields available in the NOS Hydrographic Database, but included
  in this data set are the NOS cartographic codes for bottom characteristics. Although
  included here, these codes are no longer customarily supplied by NGDC with the NOS
  Hydrographic Database. As such, this data layer provides important information that
  is no longer readily available.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
